import React,{createContext,useState} from "react";
import { baseProps } from "react-native-gesture-handler/lib/typescript/handlers/gestureHandlers";
export const BockContext =createContext();

const BockContextProvider = (props) => {
    const [books,setBooks]=useState([
        {name : "name of the wind",id : 1},
        {name : "the way of kings",id : 2},
        {name : "the find empire",id : 3},
        {name : "the hero of ages",id : 4}
    ])
    return ( 
        <BockContext.Provider value={{books}}>
            {baseProps.children}
        </BockContext.Provider>
    );
}

export default BockContext;
